import React, { useState } from "react";

function CX(){

  const [name,setName]=useState({
    fName:"",
    lName:"",
    ename:""
  });
function handel(event){
    //destructured object
    const {name,value}=event.target;
    setName(prevValue =>{
      return{
        ...prevValue,
        [name]:value
       
      }

    })
}

    return(
        <div className="container">
            <h1>Hello {name.fName}{name.lName}</h1>
            <input type="text" name="fName" onChange={handel} 
             placeholder="first name" value={name.fName}/>
            <input type="text" onChange={handel} name="lName" placeholder="last name" value={name.lName}/>
            <input type="email" onChange={handel} name="eName" placeholder="email" value={name.ename}/>
            <button>Submit</button>
        </div>
    )
}
export default CX;
